INSERT INTO `tl_newsletter` (`id`, `pid`, `tstamp`, `subject`, `alias`, `content`, `text`, `addFile`, `files`, `template`, `sendText`, `externalImages`, `sender`, `senderName`, `sent`, `date`) VALUES(1, 1, 1470658528, 'Latest Blog News', 'news-aug-16', '<p>Some dummy text.</p>\n<p>Pitchfork venmo street art fixie, shoreditch messenger bag kinfolk lomo wolf. Cronut bicycle rights cardigan four dollar toast pitchfork umami, hammock post-ironic microdosing. Blue bottle venmo cardigan blog, tilde pinterest godard gluten-free tumblr brooklyn. Single-origin coffee lomo viral pitchfork biodiesel fanny pack authentic, next level ramps brooklyn. Microdosing church-key twee next level narwhal.</p>\n<p>Bicycle rights meggings helvetica, banh mi asymmetrical keytar photo booth keffiyeh artisan sriracha wayfarers before they sold out food truck cold-pressed. Kombucha art party roof party, sriracha sartorial tofu cray pork belly chillwave.</p>', 'Some dummy text.\n\nPitchfork venmo street art fixie, shoreditch messenger bag kinfolk lomo wolf. Cronut bicycle rights cardigan four dollar toast pitchfork umami, hammock post-ironic microdosing. Blue bottle venmo cardigan blog, tilde pinterest godard gluten-free tumblr brooklyn. Single-origin coffee lomo viral pitchfork biodiesel fanny pack authentic, next level ramps brooklyn. Microdosing church-key twee next level narwhal.\n\nBicycle rights meggings helvetica, banh mi asymmetrical keytar photo booth keffiyeh artisan sriracha wayfarers before they sold out food truck cold-pressed. Kombucha art party roof party, sriracha sartorial tofu cray pork belly chillwave.', '', NULL, 'mail_default', '', '', '', 'Bunny Master', '1', '1470658534');

